subsets_X=[] #100 subsets of X
subsets_Y=[] #100 subsets of Y

for i=1:100
    subset_from_X=[]
    subset_from_Y=[]
    for j=subdataset_indx[i]
        push!(subset_from_X,X[:,j])
        push!(subset_from_Y,Y[:,j])
    end
    push!(subsets_X, hcat(subset_from_X...))
    push!(subsets_Y, hcat(subset_from_Y...))
end


## training the 100 sub-MLP models of Ensemble


ensemble_size=25#100
for i=1:ensemble_size
    println("\nStarting the training of sub-MLP: ",i)

    # Splitting the dataset into training and testing sets
    data = DataLoader((subsets_X[i], subsets_Y[i]), batchsize=2, shuffle=true)

    model = Chain(
        Dense(7, 32, softsign),     # Input layer: 7 features,   activation function
        Dense(32,32, softsign),#),
        Dense(32,32, softsign),#),
        Dense(32, 6)                # Output layer: 6 nodes
    )

    # Defining a loss function and an optimizer
    loss(model, x, y) = mean(abs2.(model(x) .- y));
    opt = Descent()

    testing_loss = Float64[]
    training_loss = Float64[]
    epochs = Int64[]

    #training the MLP
    for epoch in 1:400000
        Flux.train!(loss, model, data, opt)

        push!(epochs, epoch)
        l=loss(model, subsets_X[i],subsets_Y[i])
        l_test=loss(model, X,Y)
        push!(training_loss, l)
        push!(testing_loss, l_test)

        if epoch % 100000 == 0
            @info "Epoch $epoch and loss $(l)"
        end
    end

    @save "$(i)_sub_MLP.bson" model

    pred_MLP=[]
    pred_MLP_test=[]
    for j=1:147
        push!(pred_MLP,model(subsets_X[i][:,j]))
    end
    for j=1:210
        push!(pred_MLP_test,model(X[:,j]))
    end

    pred_MLP = hcat(pred_MLP...)
    pred_MLP_test = hcat(pred_MLP_test...)

    plot(epochs, training_loss ,label="train" , title="loss - sub-MLP_$(i)")
    plot!(epochs, testing_loss ,label="test")
    savefig("loss_sub-MLP_$(i)")

    plot(subsets_Y[i]',layout=(3,2),label="Labels")
    plot!(pred_MLP',layout=(3,2),label="Predictions")
    savefig("pred_mlp_$(i)")

    plot(Y',layout=(3,2),label="Labels")
    plot!(pred_MLP_test',layout=(3,2),label="Predictions")
    savefig("pred_mlp_testing_$(i)")

end
